import React from 'react';
import Navigation from '../components/Navigation';

import IsometricBlock from '../components/IsometricBlock';
import { DiJavascript } from 'react-icons/di';
import { DiHtml5 } from 'react-icons/di';
import { DiCss3Full } from 'react-icons/di';
import { DiReact } from 'react-icons/di';

const Home = () => {

    return (
        <div>
            <Navigation/>
            <div className="container home">

                <header>
                    <h1>Front-end developer</h1>
                    <h2>Klipfel Nicolas</h2>
                </header>

                <div className="technos">
                    <ul>
                        <IsometricBlock icon={ DiHtml5 } color={"#e34b20"} number={5}/> 
                        <IsometricBlock icon={ DiCss3Full } color={"#2187d2"} number={5}/>
                        <IsometricBlock icon={ DiJavascript} color={"yellow"} number={5}/>
                        <IsometricBlock icon={ DiReact } color={"#53d2fa"} number={3}/>
                    </ul>
                </div>

            </div> 
        </div>


    );
};

export default Home;
